/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="${classMap(context.classes)}" dir="${ifDefined(context.effectiveDir)}" role="region" aria-labelledby="${ifDefined(context.ariaLabelledByCard)}">${ context.hasHeader ? block1(context) : undefined }<div role="group" aria-label="${ifDefined(context.ariaCardContentLabel)}"><slot></slot></div><span id="${ifDefined(context._id)}-desc" class="ui5-hidden-text">${ifDefined(context.ariaCardRoleDescription)}</span></div>`; };
const block1 = (context) => { return html`<div class="ui5-card-header-root"><slot name="header"></slot></div>`; };


	return block0(context);
};

export default main;
